import React from "react";
import "./features.css";
const Features = () => {
  return (
    <>
      <div className="container feature_box">
        <div className="content">
          <div className="first">
            <h2>What is GPT3?</h2>
            <p>
              Lorem ipsum dolor sit, amet consectetur adipisicing elit. Quisquam
              eaque consequatur sed tempora quia inventore voluptas consequuntur
              nostrum enim aliquam, ab vero, rem minus eos? Aliquam ab sapiente
              fugiat quasi?
            </p>
          </div>
          <div className="second">
            <h2> The Possibilities are beyond your imagination
            </h2>
          </div>
        </div>
      </div>
    </>
  );
};

export default Features;
